const fetch = require('../../utils/fetch')
const dataResponse = require('../../utils/fetch')
// const { validate } = require('../../utils/testing/validate')
const { errors: { CredentialsError, NotFoundError } } = require('../../utils/testing/errors')

export default function () {
    return (async () => {
        const res = await fetch(`${dataResponse}`, {
            method: 'GET',
            headers: { 
                'Content-Type': 'application/json'
            }
        })

        if (res.status === 200)  {
            debugger
            return JSON.parse(res.body)
        }

        if (res.status === 400) throw new CredentialsError(JSON.parse(res.body).message)

        if (res.status === 404) throw new NotFoundError(JSON.parse(res.body).message)

        throw new Error(JSON.parse(res.body).message)
    })()
}
